import Report from 'schemas/Report.schema';
import { NextResponse } from 'next/server';
import type { NextRequest } from 'next/server';
import connectMongoose from '../helpers/connectMongoose';
import { Animal, animalValues, dangerOfAnimal } from '../enums/animalEnum';

interface createReportRequest{
    description?: string,
    photos?: Array<string>,
    latitude: number,
    longitude: number,
    danger?: boolean,
    animal: Animal
}
export function POST(request: NextRequest) {
    return handle(request);
}

async function handle(request: NextRequest) {
    let reportData = (await request.json() as createReportRequest);
    try {
        await connectMongoose();
        let animalNumber: number;
        for(let i = 0; i < 10; i++){
            animalNumber = Math.floor(Math.random() * animalValues.length)
            const report = new Report({
                ...reportData,
                latitude: 49.3 + Math.random()*1.3,
                longitude: 19.5 + Math.random()*1.1,
                animal: animalValues[animalNumber],
                danger: reportData.danger ?? dangerOfAnimal(animalValues[animalNumber] as Animal),
                photos: getRandomImage(),
                description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat."
            })
            await report.save();
        }
        return NextResponse.json(
            {
                description: "Jest w pyte"
            },
            {
                status: 200
            }
        );
    } catch (error) {
        let message = "An error has occured";
        if (error instanceof Error) {
            message = error.message;
        }
        return NextResponse.json(
            {
                description: message
            },
            {
                status: 500
            }
        );
    }
}

const fakeImages: Array<string> = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,"
]

const getRandomImage = () => {
    return [fakeImages[Math.floor(Math.random()*fakeImages.length)]];
}